using System.Diagnostics;
using System.Numerics;

class Program
{
    static double time = 6145020;
    static bool korean = true;

    static void Main(string[] args)
    {
        //인자 처리
        for(int i=0 ;i<args.Length; i++)
        {
            var it = args[i].ToLower();
            if ((it == "-t" || it == "--time") && i + 1 < args.Length)
            {
                if (!double.TryParse(args[++i] , out time))
                {
                    SayError("Limit time must be an rational number.");
                    return;
                }
            }
            else if ((it == "-l" || it == "--language") && i + 1 < args.Length)
            {
                it = args[++i].ToLower();
                if (new[] { "ko" , "korean" , "korea" }.Any(x => x == it))
                    korean = true;
                else
                    korean = false;
            }
            else if (it == "-?" || it == "--help")
            {
                SayHelp();
                return;
            }
        }
        //영역 전개
        DomainExpansion();
    }

    static void DomainExpansion()
    {
        Stopwatch stopwatch = new Stopwatch();
        stopwatch.Start();
        SayExpansion();
        BigInteger number = 1;
        BigInteger mul = 1;
        while(stopwatch.Elapsed.TotalSeconds < time)
        {
            number *= ++mul;
        }
    }
    static void SayExpansion()
    {
        SetColor();
        if (OperatingSystem.IsWindows())
        {
            try
            {
                Console.Title = korean ? "영역전개[領域展開]" : "Domain Expansion";
                Console.BufferWidth = 307;
                Console.WindowWidth = 614;
            }
            catch { }
        }
        Console.Write(UnlimitedVoidImage);
        if (korean)
        {
            Console.Write("\n「무량공처」\n무하한의 안쪽인 이 영역은 고죠 사토루 본인을 제외하고 모든 대상이 행하는 정신 활동을 무한한 반복작업으로 만듬. 영역에 잠시라도 발을 들이는 순간 뇌가 블루스크린 상태가 되어 아무 것도 할 수 없으며, 이 상태가 조금만 길게 이어져도 영구적인 뇌 손상으로 폐인이 되어 버림.");
        }
    }
    static void SayError(string message)
    {
        Console.WriteLine("Error: " + message);
    }
    static void SayHelp()
    {
        if (korean)
            Console.WriteLine("[무량공처]\n-t, --time : 시간 설정 (초 단위)\n-?, --help : 도움말 표시\n-l, --language : 언어 설정");
        else
            Console.WriteLine("[Unlimited Void]\n-t, --time : set limit time. (second)\n-?, --help : display help message.");
    }
    static void SetColor()
    {
        Console.ForegroundColor = ConsoleColor.Black;
        Console.BackgroundColor = ConsoleColor.White;
        Console.Clear();
    }
